    cnt = defaultdict(int)
    yx = defaultdict(lambda : defaultdict(int))
    for (y, x) in markers:
        cnt[y] += 1
        yx[y][x] += 1
    u = v = 0
    leftover_caps = []
    for (y, x) in caps:
        if yx[y][x] > 0:
            yx[y][x] -= 1
            cnt[y] -= 1
            v += 2
        else:
            leftover_caps.append(y)
    for y in leftover_caps:
        if cnt[y] > 0:
            cnt[y] -= 1
            u += 1
    return (u + v, v)

